import React from 'react';

const Service = () => {
    return (
        <div>
            <div className="service-section">
                <h1>Our Services</h1>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.</p>
                <div className="service-detail">
                    <div className="row">
                        <div className="col-md-4"></div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Service;
